        <body>
            <div class="slidercontainer">
                <label>minimum edge strength:
                    <input type="range" min="0" max="1" value="0.5" step="0.01" class="slider" id="min_edge_weight">
                    <input type="text" id="min_edge_weight_display" size="2">
                    Metric: <span id="edge_weight_metric" />
                </label>
            </div>
            <div id="mynetwork"></div>
            <script type="text/javascript">
    const max_lift = 4.6799987012199455
    const urlParams = new URLSearchParams(window.location.search);
    const weight_metric = urlParams.get("metric")==null ? "confidence" : urlParams.get("metric")
    const sign_color = {pos:"blue", neg:"red", zero:"black"}
    const filter_coef = {"confidence":1, "lift": max_lift, "log2lift": Math.log2(max_lift)}
    
    document.getElementById("min_edge_weight_display").value = filter_coef[weight_metric] * 0.5
    document.getElementById("min_edge_weight").onchange = function(){
        document.getElementById("min_edge_weight_display").value= filter_coef[weight_metric] * this.value
    }
    document.getElementById("edge_weight_metric").innerText = weight_metric
    
    edge_count = {} // number of edges between a given pair of nodes
    EDGE_LIST = []
    for (var i = 0; i < FULL_EDGE_LIST.length; i++) {
        edge = FULL_EDGE_LIST[i]
        edge["log2lift"] = Math.log2(edge["lift"])
        edge["value"] = Math.abs(edge[weight_metric])
        edge["title"] = weight_metric + " " + edge[weight_metric]
        edge["sign"] = (edge[weight_metric] < 0) ? "neg" : "pos";
        edge["color"] = {color: sign_color[edge["sign"]] };
        if (weight_metric=="confidence"){ // both directions
            edge["arrows"] = "to"
            EDGE_LIST.push(edge)
        } else { // one direction
            edge_key = [edge["from"], edge["to"]].sort().join(":")
            edge_count[edge_key] = (edge_count[edge_key] || 0) + 1
            if (edge_count[edge_key] == 1) EDGE_LIST.push(edge)
        }
    }
    
    const edgeFilterSlider = document.getElementById("min_edge_weight")
    
    function edgesFilter(edge){return edge.value >= edgeFilterSlider.value * filter_coef[weight_metric]}
    
    const nodes = new vis.DataSet(NODE_LIST)
    const edges = new vis.DataSet(EDGE_LIST)
    
    const nodesView = new vis.DataView(nodes)
    const edgesView = new vis.DataView(edges, { filter: edgesFilter })
    
    edgeFilterSlider.addEventListener("change", (e) => {edgesView.refresh()})
    
    const container = document.getElementById("mynetwork")
    const options = {physics:{maxVelocity: 10, minVelocity: 0.5}}
    const data = { nodes: nodesView, edges: edgesView }
    new vis.Network(container, data, options)
    
            </script>
